
var  io         = require('socket.io')
    ,sys        = require('util')
    ,connect    = require('connect')
    ,auth       = require('connect-auth')
    ,url        = require('url')
    ,fs         = require('fs')
    ,http       = require('http')
    ,db         = require('./MongoDb.js')
    ,config     = require('./config');

// load up db
db.db.init();

/* Connect application & middleware */
var app =
    connect()
    .use(connect.cookieParser('my secret herez'))
    .use(connect.session())
    .use(connect.bodyParser())

    .use(auth({
    strategies:
        [auth.Anonymous()
            ,auth.Never()
            ,auth.Facebook({appId : config.fb.id, appSecret: config.fb.secret, scope: "email", callback: config.fb.callbackAddress})
        ],
    trace: true
    // logoutHandler: require('connect-auth').redirectOnLogout("/")
    }))

    .use("/login", function(req, res, next) {
        var urlp = url.parse(req.originalUrl, true)
        req.authenticate(["facebook"],
            function(error, authenticated) {
                if( error ) {
                    // Something has gone awry, behave as you wish.
                    console.log( error );
                    res.end();
                } else {
                    if( authenticated === undefined ) {
                        // The authentication strategy requires some more browser interaction, suggest you do nothing here!
                    } else {
                        // We've either failed to authenticate, or succeeded (req.isAuthenticated() will confirm, as will the value of the received argument)
                        next();
                    }
                }
            }
        );
    })

    .use('/logout', function(req, res, params) {
        req.logout(); // Using the 'event' model to do a redirect on logout.
    })

    .use('/deauthorize', function(req, res, params) {
        res.end('Deauthorize me, set mee freee');
    })

    .use('/foo', function(req, res, params) {
        res.end('hello');
    })

    .use(function(req, res, params) {
        // res.writeHead(200, {'Content-Type': 'text/html'})
        if( req.isAuthenticated() ) {
            console.log('Authenticated: ' + JSON.stringify( req.getAuthDetails()));
            var userId = req.getAuthDetails().user.id;
            db.db.setPlayerData(req.getAuthDetails());

            var url = config.redirectAfterLogin;
            res.statusCode = 302;
            res.setHeader('Location', url);
            res.end('<p>Redirecting to <a href="' + url + '">' + url + '</a></p>');
        }
        else {
            console.log('Auth fail!')
        }
    });


var httpServer = http.createServer(app);
var sio = io.listen(httpServer);
httpServer.listen(1302)

/* Socket IO interface */
var puzzleServer = sio.sockets
    .on('connection',
        function (socket) {
            var user = socket.id;

            socket.on('place-piece',
                function (data) {
                    var x = data.x;
                    var y = data.y;
                    var pieceId = data.pieceId;
                    // var user = 'megamaster';
                    if( Puzzle.placePiece(x, y, pieceId) ) {
                        puzzleServer.emit('piece-placed',
                            {pieceId: pieceId, user: user, points: 1, x: x, y: y});
                    } else {
                        socket.emit('piece-placed-fail',
                            {pieceId: pieceId});
                    }
                    delete Puzzle.movingPieces[pieceId];
                    puzzleServer.emit('piece-positions', Puzzle.movingPieces);
                }
            );

            socket.on('get-puzzle-status',
                function() {
                    sys.puts('somebody wants status');
                    socket.emit('puzzle-status', Puzzle.getStatus());
                }
            );

            socket.on('get-me',
                function(myId) {
                    sys.puts('somebody wants his status');
                    db.db.getPlayerData(myId, function(err, data) {
                        console.log("*****************GET PLAYER DATA*****************************");
                        if(err) console.log(err);
                        console.log(data);
                        console.log("*************************************************************");
                        socket.emit('me', data);
                    });
                }
            );

            socket.on('get-leaderboard',
                function() {

                }
            );

            socket.on('piece-move',
                function(data) {
                    var x = data.x;
                    var y = data.y;
                    var pid = data.pieceId;
                    Puzzle.movePiece(pid, x, y);
                }
            );

            socket.on('get-my-pieces',
                function(view) {
                    console.log(view)
                    var pieces = Puzzle.getPiecesInView(view.left, view.top, view.right, view.bottom);
                    socket.emit('my-pieces', pieces);
                }
            );

            socket.on('insert-update-user',
                function(user) {
                    console.log(user);
                    db.db.setPlayerData(user);
                    db.db.getPlayerData(user.id, function(err, data) {
                        socket.emit('me', data);
                    })
                }
            );
        }
    );

setInterval(function() {
    if(Object.keys( Puzzle.movingPieces ).length != 0) {
        puzzleServer.emit('piece-positions', Puzzle.movingPieces);
    }
}, 100);

